// src/components/ThemeSelector.js
import React from "react";

const ThemeSelector = ({ setTheme }) => {
  return (
    <div className="theme-selector">
      <button onClick={() => setTheme("default")} className="btn btn-secondary">
        Default
      </button>
      <button onClick={() => setTheme("dark")} className="btn btn-dark">
        Dark
      </button>
      <button onClick={() => setTheme("light")} className="btn btn-light">
        Light
      </button>
    </div>
  );
};

export default ThemeSelector;
